import React, { useState } from 'react'
import Products from './components/Products'
import Extras from './components/Extras'
import Shipping from './components/Shipping'
import Submit from './components/Submit'

function App() {
  const [currentPage, setCurrentPage] = useState(<Products />)

function changePagesProducts(){
  setCurrentPage(prevPage => <Products />)
}
function changePagesExtra(){
  setCurrentPage(prevPage => <Extras />)
}
function changePagesShipping(){
  setCurrentPage(prevPage => <Shipping />)
}
function changePagesSubmit(){
  setCurrentPage(prevPage => <Submit />)
}
  return (
    <div className="container-fluid">
      <div className="row">
        <div className="col-3">
          <div className="btn-group-vertical">
            <button onClick={()=> changePagesProducts()}>Products</button>
            <button onClick={()=> changePagesExtra()}>Extras</button>
            <button onClick={()=> changePagesShipping()}>Shipping</button>
            <button onClick={()=> changePagesSubmit()}>Submit</button>
          </div>
        </div>
        <div className="col-8">
          {currentPage}
        </div>
      </div>
    </div>
  )
}

export default App
